import styled from 'styled-components'

export const Container = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    margin: 0 1rem;
`

export const VerticalBar = styled.div`
    height: 1.5rem;
    width: 2px;
    background-color: #888888;
    margin-left: .5rem;
    margin-right: .5rem;
`

export const Link = styled.a`
    color: #888888;
    font-weight: bold;
    height: 100%;
    font-size: 1rem;
    width: max-content;
    text-align: center;
`
